import React, {Component} from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      monsters: [
        {
          name: "Ankit"
        },
        {
          name: "Anulekha"
        },
        {
          name: "Swarnali"
        }
      ]
    };
  }
  render(){
    return(
      <div className="App">
        <center>
          {
            this.state.monsters.map(monster => <h6> { monster.name } </h6>)
          }
        </center>
      </div>
    )

  }
}

export default App;
